import './App.css';

// import MyMapComponent from './components/Map';
import MapContainer from './components/Map/index2'

function App() {
  return (
    <div className="App">
      <MapContainer 
        google={this.props.google}
        style={style}
        initialCenter={{
          lat: 40.854885,
          lng: -88.081807
        }}
        zoom={15}
        onClick={this.onMapClicked}
      />
    </div>
  );
}

export default App;
